import React from 'react';
import { FiFacebook, FiInstagram } from 'react-icons/fi';
import Logo from '../../components/sign';
import { Link } from 'react-router-dom'; // Eğer React Router kullanıyorsanız

import { images } from '../../constants';
import './Footer.css';

const Footer = () => (
  <div className="footer">
    <div className="footer__top">
      <div className="footer__social-icons">
        <a href="https://www.facebook.com/fistikezmecim" target="_blank" rel="noreferrer"><FiFacebook className="footer__icon" /></a>
        <a href="https://www.instagram.com/" target="_blank" rel="noreferrer"><FiInstagram className="footer__icon" /></a>
      </div>
      <p className="p__opensans">0541 203 47 66</p>
      <a href="mailto:info@fıstıkezmecim.com" className="p__opensans">info@fıstıkezmecim.com</a>
    </div>
    <div className="footer__bottom">
      <Link to="/homepage"> {/* Kullanıcıyı yönlendirmek istediğiniz sayfayı girin */}
        <div className="footer__logo">
          <Logo />
        </div>
      </Link>
      <div className="footer__copyright">
        <p className="p__opensans">© JustNut, 2023</p>
      </div>
    </div>
  </div>
);

export default Footer;
